import React, { useState } from 'react';
import './pqrs.css';

const Pqrs = () => {
    const [pqrsData, setPqrsData] = useState({
        type: '',
        name: '',
        email: '',
        description: '',
        date: ''
    });

    const [alertMessage, setAlertMessage] = useState('');

    const handleChange = (e) => {
        const { name, value } = e.target;
        setPqrsData(prevState => ({
            ...prevState,
            [name]: value
        }));
    };

    const isFormValid = () => {
        return (
            Object.values(pqrsData).every(value => value !== '') &&
            /\S+@\S+\.\S+/.test(pqrsData.email) // Validación de correo electrónico
        );
    };

    const handleSubmit = async (e) => {
        e.preventDefault();
        if (!isFormValid()) {
            setAlertMessage('Por favor, llene todos los campos correctamente antes de enviar el PQRS.');
            return;
        }
        try {
            const response = await fetch('http://127.0.0.1:8000/api/app1/pqr/', {
                method: 'POST',
                headers: {
                    'Content-Type': 'application/json'
                },
                body: JSON.stringify(pqrsData)
            });
            if (response.ok) {
                alert('Datos del formulario enviados correctamente');
                // Lógica adicional después de enviar los datos...
            } else {
                throw new Error('Error al enviar los datos del formulario');
            }
        } catch (error) {
            alert('Hubo un error al enviar el formulario. Por favor, inténtelo de nuevo más tarde.');
        }
    };

    return (
        <div className="container">
            {alertMessage && <div className="alert">{alertMessage}</div>}
            <form onSubmit={handleSubmit} className="form">
                <fieldset>
                    <legend>Formulario de PQRS</legend>
                    <div className="form-group">
                        <label htmlFor="tipoPqrs">Tipo de PQRS</label>
                        <select id="tipoPqrs" name="type" value={pqrsData.type} onChange={handleChange}>
                            <option value="">Seleccionar tipo</option>
                            <option value="peticion">Petición</option>
                            <option value="reclamo">Reclamo</option>
                            <option value="queja">Queja</option>
                            <option value="sugerencia">Sugerencia</option>
                        </select>
                    </div>
                    <div className="form-group">
                        <label htmlFor="nombreCompleto">Nombre completo</label>
                        <input type="text" id="nombreCompleto" name="name" value={pqrsData.name} onChange={handleChange} placeholder="Ingrese su nombre completo" />
                    </div>
                    <div className="form-group">
                        <label htmlFor="correoElectronico">Correo electrónico</label>
                        <input type="email" id="correoElectronico" name="email" value={pqrsData.email} onChange={handleChange} placeholder="Ingrese su correo electrónico" />
                    </div>
                    <div className="form-group">
                        <label htmlFor="descripcionPqrs">Descripción</label>
                        <textarea id="descripcionPqrs" name="description" value={pqrsData.description} onChange={handleChange} rows="5" placeholder="Ingrese la descripción de su PQRS"></textarea>
                    </div>
                    <div className="form-group">
                        <label htmlFor="fechaEnvio">Fecha de envío</label>
                        <input type="date" id="fechaEnvio" name="date" value={pqrsData.date} onChange={handleChange} />
                    </div>
                    <button type="submit" className="btn">Enviar</button>
                </fieldset>
            </form>
        </div>
    );
};

export default Pqrs;
